请为以下Python代码添加一些注释。

def fibonacci(n):
    '''这个函数将返回一个斐波那契数列中的第n个数字。'''
    if n <= 0:
        return None
    elif n == 1:
        return 0
    elif n == 2:
        return 1
    else:
        return fibonacci(n-1) + fibonacci(n-2)
